import "./App.css";
import GlassmorphismBox from "./components/glass";
import Navbar from "./components/navbar";
import Signup from "./pages/Signup";
import Login from "./pages/Login";

function App() {
	let component;
	switch (window.location.pathname) {
		case "/":
			component = <App />;
			break;
		case "/about":
			component = <About />;
			break;
		case "/blog":
			component = <Blog />;
			break;
		case "/signup":
			component = <Signup />;
			break;
		case "/login":
			component = <Login />;
			break;
	}
	return (
		<div className="App-main">
			<Navbar />
			<GlassmorphismBox />
			<component />
		</div>
	);
}

export default App;
